import React, { Component } from 'react'

class Demo extends Component {
    
    constructor(){
        super()
        this.state = {
            count : 0
        }

    }

    render(){
        return (
            <>
              <h1>Counter - {this.state.count}</h1>
            </>
        )
    }
}

export default Demo
